import React, { Component } from 'react'
import Home from './Home'
import Login from './Login'

export default class Conditional_Rendering extends Component {
   constructor(props){
    super(props)
    this.state = {
        isLogIn : true
    }
   }
  render() {
     const {isLogIn} = this.state
     let element;
     if(isLogIn){
        element = <Home/>
     }else{
        element = <Login/>
     }
     return(
        
        <div>
             {element}
        </div>

     )
     
}
}
